import { combineReducers } from 'redux';
import DataLoading from './dataLoading';
import SetUser from './setUser';
import ShowOnRight from './showOnRight';

var datal = {
    user: 'none', 
    isLeftDataLoaded: 0, 
    isRightDataLoaded: 0,  
    rightShowWelcome: 1, 
    rightShowSearchAndResults: 0, 
    rightShowVideo: 0
}

export default combineReducers({
  DataLoading,
  SetUser,
  ShowOnRight
})
